import React from 'react'

interface NavIconType {
  link: string,
  icon: string,
  quantity: number
}

export const NavIcon: React.FC<NavIconType> = ({link, icon, quantity}) => {
  return (
    <><NavIcon quantity={5} link="/wishlist" icon="fa-regular fa-heart"></NavIcon></>
  )
}
